from model.group import Groupimport randomimport stringimport os.pathimport jsondef random_string(prefix, maxlen):    symbols = string.ascii_letters + string.digits + string.punctuation + " "*10    return prefix + "".join([random.choice(symbols) for i in range(random.randrange(maxlen))])testdata = [Group(name="TestClient")] + [    Group(name= random_string("contact", 10)) for i in range(3)  ]file = os.path.join(os.path.dirname(os.path.abspath(__file__)), "../data/groups.json")with open(file, "w") as f:    f.write(json.dumps(testdata, default= lambda x: x.__dict__, indent=2))